import { useState } from "react";

const Display =(props)=>{

    const [animeList] = useState(props);
    const {anime,name,move,skill}=props.animeList;
    
    return(
        <>
        <h2>DISPLAY VALUE</h2>
        <div>
            <label htmlFor="">FROM: {anime}</label>
        </div>
        <div>
            <label htmlFor="">CHARACTER NAME:{name}</label>
        </div>
        <div>
            <label htmlFor="">CHARACTER MOVE:{move}</label>
        </div>
        <div>
            <label htmlFor="">CHARACTER SKILL:{skill}</label>
        </div>
      </>
      
    );
    
}
export default Display;
